Mother Lovers Society 4 - Sweetheart Video. In Volume 4 of Sweetheart's top rated lesbian soap opera, Magdalene confronts Darla about her tryst with younger lover Kasey, while Kasey's sugar-mama Erica tracks down Kasey's long lost mother Kate Kastle. As the older women start to put together the pieces of Kasey's sordid childhood, Magdalene realizes she needs help beating her addiction to sex with teenage girls. She calls upon therapist Sydni Ellis to help her reach that goal - but Sydni has her own dark secrets involving sex with young girls.
